ball <-
function (n, r = 1, hole = 0, x0 = 0, y0 = 0, from = 0, to = 1) 
{
	rPos  = sqrt(
			  runif(n) * 
			  (r^2 - hole^2) + 
			  hole^2
			)
	theta = 2 * (from + runif(n) *(to - from)) * pi
	X     = rPos * cos(theta)
	Y     = rPos * sin(theta)

	list(x = X + x0, y = Y + y0)
}
