print.jointSample <-
function (x, ...) 
{
    cat("Joint Sample\n")
    print(unclass(x), ...)
    invisible(x)
}
randCopula <-
function (cop, sample) 
{
	size = length(cop$x)
	ss = lapply(sample, sort)
	list(
		x = ss$x[cop$x *(size + 1)], 
		y = ss$y[cop$y *(size + 1)]
		)
}
